INSERT INTO `data` (`id`, `inventory_id`, `title`, `description`, `period`, `city`, `gallery`, `dimension`, `artist`, `material`, `accession_no`, `clue`, `cluedisp`) VALUES
(1, 178.29, 'Dish', 'The intricate carvings on the edges and the centre of this small rectangular dish from Agra, blends geometrical Indian motifs with European foliage patterns. Soapstone, a type of metamorphic rock, is known for its extreme softness and permits delicate treatment in design and workmanship. Agra is the principal centre for this art form in India, where the stone carvers also specialise in the inlaid marble work.', '1900 - 1926', 'Agra', 'Industrial Arts Gallery', 'Length = 22.7 cm, Breadth = 17.2 cm, Width = 1.4 cm, Weight = 635 gm', 'AAA', 'Soapstone', 178.29, 'found in AGRA nd madeup of SOAPSTONE....GUESS ME????', 0),
(2, 58.12, 'Box with a key\r\n', 'This box from Multan, with silver and gold wire inlay in a complex and intricate pattern, exemplifies the Museum''s Koftagiri (Damascene) collection. The art of damascening originated in the ornamentation of weaponry in ancient Damascus and travelled to India via Iran and Afghanistan. The famous Ganga-Jamuna style is used here where both gold and silver ornamentation is employed for dramatic effect. The edge of the lid also has been crafted in a delicate shape. This technique is still practised today in Udaipur, Jaipur, Alwar and Sirohi in Rajasthan, Datia in Madhya Pradesh, Trivandrum and Bidar in the South and in Kashmir.\r\n', '1911 - 1912', 'Multan\r\n', 'Industrial Arts Gallery\r\n', 'Ht. 8.2 cm; L. 25.1 cm; B. 10.9 cm; Wt. 1498 g.\r\n', 'BBB', 'Iron, silver, gold\r\n', 58.12, '	\r\nfound in MULTAN nd madeup of Iron, silver, gold....GUESS ME??...', 0),
(3, 136.39, 'Vase', 'Among the earliest experiments carried out at the Bombay School of Art or the Sir J.J. School of Art, Mumbai were the successful efforts to improve the production of different types of pottery. The workshops experimented with new types of clays, glazes, forms and designs. The floral patterns and colours observed on this glazed vase seem to be inspired by Art Noveau designs. The form of this pot is similar to classical Greek and Roman pottery as the School was experimenting with new techniques and forms. This pottery was much admired and popular at international exhibitions.', '1870-1950', 'Mumbai', 'Industrial Arts Gallery', 'H = 28 cm, Diameter (mouth) = 10.9 cm, Diameter (body) = 22.5 cm, Weight = 1,785 gm', 'CCC', 'Clay, pigment', 136.39, 'found in MUMBAI nd madeup of Clay, pigment....GUESS ME??...', 0),
(4, 29.25, 'An image of a Goddess, Nepal', 'This silver and brass image shows a silver eighteen-armed Durga  riding a lion, subduing  with her left leg. The demon is shown arising out of a buffalo, whose head Durga has severed. ', '1850-1920', 'Nepal', 'Industrial Arts Gallery', '"L = 14.4 cm, W = 9.2 cm, H =  19.4 cm,  Weight = 552 gm"', 'DDD', 'Silver, Brass and semi precious stones ', 29.25, 'found in NEPAL nd madeup of Silver, Brass and semi precious stones ....GUESS ME??...', 1),
(5, 3.22, 'Peacock', 'This figure of a peacock, holding a snake in its beak, has been carved out of walrus tusk. Peacocks were popular subjects for depiction on decorative objects produced in Japan. Trade between Japan and India under the British Empire started when select Japanese ports were opened up to the British in 1858. Alliance between these two empires was further extended through Japenese exhibitions held in London in 1885 and in 1910. The British Empire promoted trade between India and Japan and this object is a testimony of friendly relations that existed between Great Britain and Japan.', '1924 - 1935', 'Japan', 'Industrial Arts Gallery', 'H = 22.0 cm, L = 9.1 cm, W = 5.7 cm, Weight = 303 gm ', 'EEE', 'Bone', 3.22, 'found in JAPAN nd madeup of BONE....GUESS ME??...', 0);

